import React from "react";
import Header from "./layout/Header";
class TodoApp extends React.Component {
    render() {
        return (
        <div>
            <Header/>
        </div>)
    }
}
export default TodoApp; 

state = {
    todo: [
        {
            id:1,
            title: "Setup Appearance",
            completed: true,
        },
        {
            id: 2,
            title: "Create parent component",
            completed: true,
        },
        {
            id: 3,
            title: "Create method component",
            completed: false,
        }
    ]
}
